"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:16pt;\">Aplicația realizează recunoașterea facială </span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">dintr-o îregistrare video în timp real sau deja existentă și din imagini.</span></p>\n"
