"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">Pentru a realiza recunoașterea facială dintr-o imagine se va apăsa pe butonul &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Upload</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot; din tab-ul &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Photo</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot;, se va selecta imaginea dorită și aceasta va fi încărcată în interfața aplicației, iar apoi, prin apăsarea butonului &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Recognition</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot; se va realiza recunoașterea, apărând pe fețele oamenilor prezenți în imagine un chenar și numele lor, dacă există în sistem, sau &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">unknown</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot;, dacă nu îî recunoaște.</span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'sans-serif\'; font-size:16pt;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">Pentru a realiza recunoașterea facială dintr-o înregistrare deja existentă, în tab-ul &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Video</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot; se va apăsa pe butonul &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Upload</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot; se va selecta înregistrarea dorită, dar aceasta nu va fi încărcată în interfața aplicației. Prin apăsarea butonului &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Recognition</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot; se va încărca înregistrarea în interfată și se va realiza, totodată, recunoașterea fețelor. Pentru a încărca o nouă înregistrare va trebui oprită cea precedentă, apăsând pe butonul &quot;</span><span style=\" font-family:\'sans-serif\'; font-size:16pt; font-style:italic;\">Stop</span><span style=\" font-family:\'sans-serif\'; font-size:16pt;\">&quot;, care o va opri.</span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'sans-serif\'; font-size:16pt;\"><br /></p>\n"
